var canvas = document.getElementById('DemoCanvas');
canvas.width = document.getElementsByTagName("html")[0].offsetWidth;
canvas.height = document.getElementsByTagName("html")[0].offsetHeight;
context = canvas.getContext('2d');
context.beginPath();
var originX = data[0]["x"]
var originY = data[0]["y"]
var unitime = 10
context.moveTo(data[0]["x"], data[0]["y"]);
context.stroke();
context.strokeStyle = "red";

function LineTo(x2, y2) {
    context.lineTo(x2, y2);
    context.moveTo(x2, y2);
    context.stroke();
    context.strokeStyle = "red";
}

function seqProcess(point1, point2) {
    let timeLen = point2["time"] - point1["time"]
    let trytimes = Math.ceil(timeLen / unitime)
    let cx1 = point1["x"]
    let cx2 = point2["x"]
    let cy1 = point1["y"]
    let cy2 = point2["y"]
    let xstep = (cx2 - cx1) / trytimes
    let ystep = (cy2 - cy1) / trytimes

    function rundraw(index) {
        if (index >= trytimes) {
            return;
        }
        setTimeout(function() {
            // console.log(cx1 + xstep * index, cy1 + ystep * index)
            LineTo(cx1 + xstep * index, cy1 + ystep * index)
            rundraw(index + 1)
        }, unitime)
    }
    rundraw(0)
}

function start(index) {
    if (index >= data.length - 1) {
        return
    }
    setTimeout(function() {
        console.log(data[index])
        seqProcess(data[index], data[index + 1]);
        start(index + 1)
    }, Math.ceil((data[index + 1]["time"] - data[index]["time"]) / unitime) * unitime)
}
